import{_ as e,o as t,c as i,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 9.1-911 Registry maintenance.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/9.1-911.md","filePath":"vacode/9.1-911.md"}'),a={name:"vacode/9.1-911.md"},n=r('<h1 id="§-9-1-911-registry-maintenance" tabindex="-1">§ 9.1-911 Registry maintenance. <a class="header-anchor" href="#§-9-1-911-registry-maintenance" aria-label="Permalink to &quot;§ 9.1-911 Registry maintenance.&quot;">​</a></h1><p>The Registry shall include conviction data received from the courts, including the disposition records for juveniles tried and convicted in the circuit courts pursuant to § <a href="/vacode/16.1-269.1/">16.1-269.1</a>, on convictions for offenses for which registration is required and registrations, reregistrations, and verifications of registration information received from persons required to do so. The Registry shall also include a separate indication that a person has been convicted of a Tier III offense. The State Police shall forthwith transmit the appropriate information as required by the Federal Bureau of Investigation for inclusion in the National Sex Offender Registry.</p><p>2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0584" target="_blank" rel="noreferrer">584</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0829" target="_blank" rel="noreferrer">829</a>.</p>',3),o=[n];function s(c,d,l,f,h,_){return t(),i("div",null,o)}const u=e(a,[["render",s]]);export{g as __pageData,u as default};
